@bot.message_handler(func=lambda message: True)
def handle_cards(message):
    try:
        # تحليل الرسالة
        text = message.text.strip()
        
        # تجاهل الأوامر
        if text.startswith('/'):
            return
            
        cards = [line.strip() for line in text.split('\n') if line.strip() and '|' in line]
        
        if not cards:
            bot.reply_to(message, "❌ No valid cards found\n\nFormat: CardNumber|MM|YYYY|CVV")
            return
        
        if len(cards) > 50:
            bot.reply_to(message, "❌ Maximum 50 cards at once")
            return
        
        # رسالة البداية
        status_msg = bot.reply_to(message, f"🔄 Checking {len(cards)} card(s)...")
        
        results = []
        approved_count = 0
        declined_count = 0
        error_count = 0
        
        # فحص كل بطاقة
        for i, card in enumerate(cards, 1):
            # تحديث الحالة
            if len(cards) > 1 and i % 3 == 0:
                try:
                    bot.edit_message_text(
                        f"🔄 Checking... ({i}/{len(cards)})",
                        message.chat.id,
                        status_msg.message_id
                    )
                except:
                    pass
            
            result = checker.check_card(card)
            results.append(result)
            
            # إحصائيات
            if result['status'] == 'APPROVED':
                approved_count += 1
            elif result['status'] == 'DECLINED':
                declined_count += 1
            else:
                error_count += 1
            
            # تأخير بسيط
            if len(cards) > 1:
                time.sleep(0.5)
        
        # إعداد النتيجة النهائية
        final_message = (
            f"📊 Results:\n"
            f"━━━━━━━━━━━━━━━━\n"
            f"✅ Approved: {approved_count}\n"
            f"❌ Declined: {declined_count}\n"
            f"⚠️ Errors: {error_count}\n"
            f"━━━━━━━━━━━━━━━━\n"
            f"📋 Details:\n"
        )
        
        # إضافة تفاصيل كل بطاقة
        for result in results:
            final_message += f"\n{result['message']}"
            final_message += f"\n└ Card: {result['card']}"
            if result['details']:
                final_message += f"\n└ Info: {result['details']}"
            final_message += "\n"
        
        # إرسال النتيجة
        if len(final_message) > 4096:
            # تقسيم الرسالة الطويلة
            chunks = []
            current_chunk = final_message[:4000]
            remaining = final_message[4000:]
            
            chunks.append(current_chunk)
            
            while remaining:
                chunk = remaining[:4000]
                remaining = remaining[4000:]
                chunks.append(chunk)
            
            bot.edit_message_text(chunks[0], message.chat.id, status_msg.message_id)
            for chunk in chunks[1:]:
                bot.send_message(message.chat.id, chunk)
        else:
            bot.edit_message_text(final_message, message.chat.id, status_msg.message_id)
            
    except Exception as e:
        bot.reply_to(message, f"❌ Error: {str(e)}")

